def extract_lotto_number(Probability_Numbers_Lists):
    lotto_numbers =[]
    for i in range(len(Probability_Numbers_Lists)):
        lotto_num = random.choices(range(1,46), Probability_Numbers_Lists[i])
        lotto_numbers.append(lotto_num) 
    lotto_numbers = sum(lotto_numbers,[])
    
    
    for m in collections.Counter(lotto_numbers).values():
        if m>1:
            lotto_numbers = extract_lotto_number(Probability_Numbers_Lists)
            break
            
    return lotto_numbers

def list_of_won_the_lucky(DataFrame):
    l = []
